" <div id=\"topicContent\">",
"  <div id=\"topicTitle\">",
"   Diaphragmatic paralysis in the newborn",
"  </div>",
"  <div id=\"topicContributors\">",
"   <div>",
"    <a id=\"authors\">",
"    </a>",
"    <a class=\"contributor contributor_credentials contributorType\" href=\"mobipreview.htm?36/5/36951/contributors\">",
