"    <a class=\"contributor contributor_credentials\" href=\"mobipreview.htm?36/5/36951/contributors\">",
"     Joseph A Garcia-Prats, MD",
"    </a>",
"    <br/>",
"    <a class=\"contributor contributor_credentials\" href=\"mobipreview.htm?36/5/36951/contributors\">",
